import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

const LoginForm = () => {
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const navigate = useNavigate();

  const handleLogin = async (e) => {
    e.preventDefault();

    const response = await fetch("https://qa-uaesaas-api.instapract.ae/web/api/default/login", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
        APPID: "Gem3s12345",
      },
      body: JSON.stringify({
        username,
        password,
        role_id: "143f37f2-ca38-0ab1-2489-1e47113655fc",
        device_id: "55c3389cb5ddd720dc0297617f3561c43a36218a277c974c8d43d545a643f45c",
        os_id: "b93a9204-ee21-4cf9-8a94-cf5eeabf7301",
        language: "da315627-3ece-2016-c628-b61dc5ee9be0",
      }),
    });

    const data = await response.json();
    console.log("Login Response:", data);

    if (response.ok && data.token) {
      localStorage.setItem("token", data.token);
      navigate("/doctors"); // ✅ Navigate to DoctorList
    } else {
      alert("Login failed");
    }
  };

  return (
    <form onSubmit={handleLogin} className="p-6 space-y-4">
      <input
        className="border p-2 w-full"
        value={username}
        onChange={(e) => setUsername(e.target.value)}
        placeholder="Username"
      />
      <input
        className="border p-2 w-full"
        value={password}
        onChange={(e) => setPassword(e.target.value)}
        placeholder="Password"
        type="password"
      />
      <button type="submit" className="bg-blue-500 text-white px-4 py-2 rounded">
        Login
      </button>
    </form>
  );
};

export default LoginForm;
